import { Component } from '@angular/core';
import { Jogadores } from './Jogadores';
import { JogadoresserviceService } from 'src/app/services/jogadoresservice.service';


@Component({
  selector: 'app-jogadores',
  templateUrl:'./jogadores.component.html',
  styleUrls: ['./jogadores.component.css']
})
export class ogadoresComponent {

  constructor(private Jogadoresservice: JogadoresserviceService){
    this.getCardapio()
  }


  ngOnInit():void{}

  cardapios: Jogadores[] = [];

  getCardapio():void{
    this.Cardapioservice.getAll().subscribe((Cardapio) => (this.cardapios = Cardapio));
  }

}
